#include <iostream>
using namespace std;

class Solution {
public:
    bool validPalindrome(string s) {
        int size = s.size()-1;
        int start = 0;
        while(start < size) {
            if(s[start] == s[size]){
                start++;
                size--;
            }else{
                return checkPalindrome(s, start+1, size)||checkPalindrome(s, start, size-1);
            }
        }
        return true;
    }
    bool checkPalindrome(string s, int i, int size){
        for(; i < size; i++, size--){
            if(s[i] != s[size]) return false;
        }
        return true;
    }
};

int main(){
    string s = "What";
    s.erase(2, 1);
    cout<<s.length()<<endl;
    cout<<s<<endl;
    Solution sol;
    cout<<sol.validPalindrome("");

    return 0;
}